import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ProfileSearch from './ProfileSearch';

function App() {
    return (
        <>
        <p>Hi!</p>
        <Router>        
            <div>
                <Routes>
                    <Route exact path="https://sak-productivity-suite.herokuapp.com/profile-search" element={<ProfileSearch />} />
                </Routes>
            </div>
        </Router>
        </>
    );
}
export default App;
